import * as React from "react";
import {
  Box,
  Typography,
} from "@mui/material";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import ArrowBackIcon from "@mui/icons-material/ArrowBack";
import ArrowForwardIcon from "@mui/icons-material/ArrowForward";
const SampleNextArrow = (props) => {
  const { className, style, onClick } = props;
  return (
    <div
      onClick={onClick}
      className={className}
      style={{
        ...style,
        width: 48,
        height: 15,
        display: "block",
        right: "0",
        top: "50%",
        bottom: -40,
        zIndex: 1,
        borderRradius: "10px 0px 0px 10px",
      }}
    >
      <ArrowForwardIcon color="primary" />
      {/* <img
        // src={ImageUrl.ic_carousol_next}
        src={<ArrowForwardIcon />}
        width={48}
        height={32}
        alt="ic_carousol_next"
      /> */}
    </div>
  );
};

const SamplePrevArrow = (props) => {
  const { className, style, onClick } = props;
  return (
    <div
      onClick={onClick}
      className={className}
      style={{
        ...style,
        width: 48,
        height: 15,
        display: "block",
        left: "0",
        top: "50%",
        bottom: -40,
        zIndex: 1,
        borderRradius: "10px 0px 0px 10px",
        wi
      }}
    >
      <ArrowBackIcon color="primary" />
      {/* <img
        // src={ImageUrl.ic_carousol_prev}
        src={<ArrowBackIcon />}
        width={48}
        height={32}
        alt="ic_carousol_prev"
      /> */}
    </div>
  );
};
function BannerSlider() {
        const settings = {
          dots: false,
          arrows: true,
          autoplay: true,
          nextArrow: <SampleNextArrow className="dsnb"/>,
          prevArrow: <SamplePrevArrow />,
          autoplaySpeed: 4000,
          centerMode: true,
          centerPadding: "0px",
          infinite: true,
          initialSlide: 0,
          slidesToShow: 1,
          slidesToScroll: 1,
          swipeToSlide: true,
        };
  return (
    <>
      <Box className="fffff" sx={{ mb: 5,mt:8.4, }}>
        <Slider
          {...settings}
          sx={{
            "&.slick-dots li button:before": {
              fontSize: "16px",
            },
            "&.slick-dots li.slick-active button:before": {
              color: "#00ca9d",
            },
          }}
        >
          <Box>
            <Box
              sx={{
                backgroundColor: "#ab47bc",
                width: "100%",
                height: "400px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Typography variant="h2">Comming Soon</Typography>
            </Box>
          </Box>
          <Box>
            <Box
              sx={{
                backgroundColor: "#9575cd",
                width: "100%",
                height: "400px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Typography variant="h2">Comming Soon</Typography>
            </Box>
          </Box>

          <Box>
            <Box
              sx={{
                backgroundColor: "#9575cd",
                width: "100%",
                height: "400px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Typography variant="h2">Comming Soon</Typography>
            </Box>
          </Box>
        </Slider>
      </Box>
    </>
  );
}
export default BannerSlider;
